import React from "react";
import IntlMessages from "../../../../../util/IntlMessages";
import Fab from "@material-ui/core/Fab";
import AddIcon from "@material-ui/icons/Add";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";
import RemoveSharpIcon from "@material-ui/icons/RemoveSharp";
import GetAppIcon from "@material-ui/icons/GetApp";
import { connect } from "react-redux";
import {
  KeyboardDatePicker,
  MuiPickersUtilsProvider,
} from "@material-ui/pickers";
import DateFnsUtils from "@date-io/moment";
import InputLabel from "@material-ui/core/InputLabel";
import Select from "react-select";
import AddBox from "@material-ui/icons/AddBox";
import Typography from "@material-ui/core/Typography";
import WcIcon from "@material-ui/icons/Wc";
import { Radio } from "@material-ui/core";
import CheckCircleIcon from "@material-ui/icons/CheckCircle";
import DeleteOutlineIcon from "@material-ui/icons/DeleteOutline";
import PrintIcon from "@material-ui/icons/Print";
import PictureAsPdfIcon from "@material-ui/icons/PictureAsPdf";
import { getAllRole } from "../../../../../actions/usersAction";
import PhotoIcon from "@material-ui/icons/Photo";
import {
  roleIdSuperAdmin,
  roleIdAdmin,
  roleIdProfessor,
  roleIdStudent,
  roleIdDirector,
  roleIdParent,
  roleIdSupervisor,
} from "../../../../../config/config";
import {
  isEmail,
  isPhonenumber,
  isZipCode,
  isCIN,
  isValidphoneNumber,
} from "../../../../../constants/validationFunctions";
import MuiPhoneNumber from "material-ui-phone-number";
import { parsePhoneNumberFromString } from "libphonenumber-js";
import moment from "moment";
import RemoveIcon from "@material-ui/icons/Remove";

const fonctionList = [
  { label: "Agent d'entretien", id: 1, value: 1 },
  { label: "Infirmière", id: 2, value: 2 },
  { label: "Cuisinier(e)", id: 3, value: 3 },
  { label: "Gardien", id: 4, value: 4 },
  { label: "surveillant", id: 5, value: 5 },
  { label: "surveillant général", id: 6, value: 6 },
];
class AddUsers extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  isValidphoneNumber = (number) => {
    const tel = parsePhoneNumberFromString(number);
    let res = false;
    if (tel) {
      res = tel.isValid();
    }
    return res;
  };
  render() {
    const { values } = this.props;
     return (
      <div className="col-lg-12 col-md-12 col-sm-12 d-flex flex-wrap align-items-start">
        <div className="col-lg-12 col-md-12 col-sm-12 d-flex flex-row flex-wrap  justify-content-between align-items-center">
          <div className="d-flex flex-row ">
            <Fab
              size="small"
              color="primary"
              aria-label="Add"
              onClick={this.props.openAddModal}
            >
              {this.props.values.isOpen ? <RemoveSharpIcon /> : <AddIcon />}
            </Fab>
            &nbsp;&nbsp;&nbsp;
            <Typography
              variant="h6"
              style={{
                color: "black",
                fontWeight: "blod",
                fontFamily: "Roboto",
                fontSize: "25px",
              }}
            >
              <IntlMessages id="add.new.user" />
            </Typography>
          </div>
          &nbsp;&nbsp;&nbsp;
          <div className="d-flex flex-row">
            <Fab
              size="small"
              color="secondary"
              aria-label="Add"
              // onClick={this.props.openAddModal}
            >
              <GetAppIcon />
            </Fab>
            &nbsp;&nbsp;&nbsp;
            <Typography
              variant="h6"
              style={{
                color: "black",
                fontWeight: "blod",
                fontFamily: "Roboto",
                fontSize: "25px",
              }}
            >
              <IntlMessages id="upload.file.user" />
            </Typography>
          </div>
          &nbsp;&nbsp;&nbsp;
          <div className="d-flex flex-row ">
            <Fab
              size="small"
              aria-label="Add"
              style={{ backgroundColor: "#ffbb33", color: "#ffffff" }}
             // onClick={this.props.openArchive}
            >
              <DeleteOutlineIcon />
            </Fab>
            &nbsp;&nbsp;&nbsp;
            <Typography
              variant="h6"
              style={{
                color: "black",
                fontWeight: "blod",
                fontFamily: "Roboto",
                fontSize: "25px",
              }}
            >
              <IntlMessages id="service.button.archives" />
            </Typography>
          </div>
          <div className="d-flex flex-row justify-content-between">
            &nbsp;&nbsp;&nbsp;
            <PrintIcon
              style={{
                fontSize: "35",
              }}
              color="inherit"
            />
            &nbsp;&nbsp;&nbsp;
            <PictureAsPdfIcon
              style={{
                fontSize: "35",
              }}
              color="inherit"
            />
          </div>
        </div>

        <form
          className="d-flex  flex-wrap col-lg-12 col-md-12 col-sm-12 p-4"
          autoComplete="off"
          onSubmit={this.props.handleSubmit}
        >
          {this.props.values.isOpen ? (
            <>
              <div className=" d-flex col-lg-12 col-md-12 col-sm-12 flex-row flex-wrap justify-content-around align-items-center">
                <div className="col-md-6 col-lg-2 col-sm-12 p-0">
                  <InputLabel
                    htmlFor="nomSelect"
                    style={{
                      fontFamily: "Roboto",
                      fontSize: "18px",
                    }}
                    required
                  >
                    {<IntlMessages id="role.user" />}
                  </InputLabel>
                  <Select
                    required
                    options={this.props.values.listRoles}
                    onChange={this.props.handleChangeRole}
                    id="role"
                    name="role"
                    styles={{
                      control: (base) => ({
                        ...base,
                        "&:hover": { borderColor: "gray" }, // border style on hover
                        border: "1px solid lightgray", // default border color
                        boxShadow: "none", // no box-shadow
                        borderTopStyle: "none",
                        borderRightStyle: "none",
                        borderLeftStyle: "none",
                        borderRadius: " none",
                      }),
                    }}
                  />{" "}
                </div>
                <div className="col-md-6 col-lg-2 col-sm-12 p-0">
                  <InputLabel
                    htmlFor="nomSelect"
                    style={{
                      fontFamily: "Roboto",
                      fontSize: "18px",
                    }}
                    required
                  >
                    {<IntlMessages id="school.year.user" />}
                  </InputLabel>
                  <Select
                    options={this.props.values.listSchoolYears}
                    onChange={this.props.handleChangeSchoolYear}
                    id="role"
                    name="role"
                    styles={{
                      control: (base) => ({
                        ...base,
                        "&:hover": { borderColor: "gray" }, // border style on hover
                        border: "1px solid lightgray", // default border color
                        boxShadow: "none", // no box-shadow
                        borderTopStyle: "none",
                        borderRightStyle: "none",
                        borderLeftStyle: "none",
                        borderRadius: " none",
                      }),
                    }}
                  />{" "}
                </div>
                {this.props.userProfile.role_id === roleIdSuperAdmin ? (
                  <>
                    <div className="col-md-6 col-lg-2 col-sm-12 p-0">
                      <InputLabel
                        htmlFor="nomSelect"
                        style={{
                          fontFamily: "Roboto",
                          fontSize: "18px",
                        }}
                        required
                      >
                        {<IntlMessages id="user.establishment" />}
                      </InputLabel>
                      <Select
                        options={this.props.values.establishmentsList}
                        onChange={this.props.handleChangeEstablishments}
                        id="role"
                        name="role"
                        styles={{
                          control: (base) => ({
                            ...base,
                            "&:hover": { borderColor: "gray" }, // border style on hover
                            border: "1px solid lightgray", // default border color
                            boxShadow: "none", // no box-shadow
                            borderTopStyle: "none",
                            borderRightStyle: "none",
                            borderLeftStyle: "none",
                            borderRadius: " none",
                          }),
                        }}
                      />{" "}
                    </div>
                  </>
                ) : (
                  ""
                )}
                {this.props.values.roleId === roleIdStudent ? (
                  <>
                    <div className="col-md-6 col-lg-3 col-sm-12 p-0">
                      <InputLabel
                        htmlFor="nomSelect"
                        style={{
                          fontFamily: "Roboto",
                          fontSize: "18px",
                        }}
                      >
                        {<IntlMessages id="parent.couplage.user" />}
                      </InputLabel>
                      <Select
                        options={this.props.parentsList}
                        onChange={this.props.handleChangeParent}
                        id="role"
                        name="role"
                        styles={{
                          control: (base) => ({
                            ...base,
                            "&:hover": { borderColor: "gray" }, // border style on hover
                            border: "1px solid lightgray", // default border color
                            boxShadow: "none", // no box-shadow
                            borderTopStyle: "none",
                            borderRightStyle: "none",
                            borderLeftStyle: "none",
                            borderRadius: " none",
                          }),
                        }}
                      />{" "}
                    </div>
                    <div className="col-md-6 col-lg-3 col-sm-12 p-0">
                      <InputLabel
                        htmlFor="nomSelect"
                        style={{
                          fontFamily: "Roboto",
                          fontSize: "18px",
                        }}
                        required
                      >
                        {<IntlMessages id="classe.couplage.user" />}
                      </InputLabel>
                      <Select
                        options={this.props.values.classForStudent}
                        onChange={this.props.handleChangeStudentClass}
                        id="nomSelect"
                        styles={{
                          control: (base) => ({
                            ...base,
                            "&:hover": { borderColor: "gray" }, // border style on hover
                            border: "1px solid lightgray", // default border color
                            boxShadow: "none", // no box-shadow
                            borderTopStyle: "none",
                            borderRightStyle: "none",
                            borderLeftStyle: "none",
                            borderRadius: " none",
                          }),
                        }}
                      />{" "}
                    </div>
                  </>
                ) : (
                  ""
                )}
                {this.props.values.roleId === roleIdProfessor ? (
                  <>
                    <div className="col-md-6 col-lg-3 col-sm-12 p-0 "> </div>
                    <div className="col-md-6 col-lg-3 col-sm-12 p-0 "> </div>
                  </>
                ) : (
                  ""
                )}
                {this.props.values.roleId === roleIdProfessor ? (
                  <>
                    {values.listOfSubjects.map((objSubject, index) => (
                      <div className="col-md-6 col-lg-12 col-sm-12 d-flex flex-row justify-content-between p-3">
                        <div className="col-md-6 col-lg-3 col-sm-12 p-0 ">
                          <InputLabel
                            htmlFor="nomSelect"
                            style={{
                              fontFamily: "Roboto",
                              fontSize: "18px",
                            }}
                            required
                          >
                            {<IntlMessages id="prof.couplage.class" />}
                          </InputLabel>
                          <Select
                            options={this.props.values.classRoomList}
                            onChange={(e) =>
                              this.props.handleChangeClassRoom(
                                e,
                                "classId",
                                index
                              )
                            }
                            id="classId"
                            name="classId"
                            styles={{
                              control: (base) => ({
                                ...base,
                                "&:hover": { borderColor: "gray" }, // border style on hover
                                border: "1px solid lightgray", // default border color
                                boxShadow: "none", // no box-shadow
                                borderTopStyle: "none",
                                borderRightStyle: "none",
                                borderLeftStyle: "none",
                                borderRadius: " none",
                              }),
                            }}
                          />{" "}
                        </div>
                        <div className="col-md-6 col-lg-3 col-sm-12 p-0">
                          <InputLabel
                            htmlFor="nomSelect"
                            style={{
                              fontFamily: "Roboto",
                              fontSize: "18px",
                            }}
                            required
                          >
                            {<IntlMessages id="prof.couplage.subjects" />}
                          </InputLabel>
                          <Select
                            options={objSubject.subjects}
                            onChange={(e) =>
                              this.props.handleChangeClassRoom(
                                e,
                                "subjectId",
                                index
                              )
                            }
                            // value={this.props.values.subjectItem}
                            id="subjectId"
                            name="subjectId"
                            styles={{
                              control: (base) => ({
                                ...base,
                                "&:hover": { borderColor: "gray" }, // border style on hover
                                border: "1px solid lightgray", // default border color
                                boxShadow: "none", // no box-shadow
                                borderTopStyle: "none",
                                borderRightStyle: "none",
                                borderLeftStyle: "none",
                                borderRadius: " none",
                              }),
                            }}
                          />{" "}
                        </div>
                        <div className="col-md-6 col-lg-2 col-sm-12 p-0">
                          <Fab
                            size="small"
                            value={`${index}`}
